class MinStack:

    def __init__(self):

        self.Stack = []
        self.minVal = None


    def push(self, val: int) -> None:

        if not self.Stack or self.minVal == None:
            self.minVal = val


        if not self.Stack: 
            self.Stack.append(val)
        elif val < self.minVal: 
            self.Stack.append(2*val - self.minVal)
            self.minVal = val
        else: 
            self.Stack.append(val)


    def pop(self) -> None:

        if not self.Stack: 
            return
        elif self.Stack[-1] < self.minVal: 
            self.minVal = 2*self.minVal - self.Stack[-1]
            self.Stack.pop()
        else: 
            self.Stack.pop()


    def top(self) -> int:

        if self.Stack[-1] > self.minVal : 
            return self.Stack[-1]
        else: 
            return self.minVal


    def getMin(self) -> int:

        return self.minVal




