    def restoreString(self, s: str, indices: List[int]) -> str:
        s = list(s)

        for i in range(len(indices)):
            while i != indices[i]:
                tmp = indices[i]
                indices[i] = indices[tmp]
                indices[tmp] = tmp

                s[i], s[tmp] = s[tmp], s[i]

        return ''.join(s);"class Solution:

